import * as types from "../../actionTypes";
import TaxpayerinfoApi from "../../../api/TaxpayerinfoApi";

let actionsFunction = {

  //CRUD METHODS

  // Create taxpayerinfo
  createTaxpayerinfo: function(taxpayerinfo) {
    return function(dispatch) {
      return TaxpayerinfoApi
        .createTaxpayerinfo(taxpayerinfo)
        .then(taxpayerinfo => {
          dispatch(actionsFunction.createTaxpayerinfoSuccess(taxpayerinfo));
        })
        .catch(error => {
          throw error;
        });
    };
  },

  createTaxpayerinfoSuccess: function(taxpayerinfo) {
    return { type: types.CREATE_TAXPAYERINFO_SUCCESS, payload: taxpayerinfo };
  },


  // Delete taxpayerinfo
  deleteTaxpayerinfo: function(id) {
    return function(dispatch) {
      return TaxpayerinfoApi
        .deleteTaxpayerinfo(id)
        .then(taxpayerinfo => {
          dispatch(actionsFunction.deleteTaxpayerinfoSuccess(taxpayerinfo));
        })
        .catch(error => {
          throw error;
        });
    };
  },

  deleteTaxpayerinfoSuccess: function(taxpayerinfo) {
    return { type: types.DELETE_TAXPAYERINFO_SUCCESS, payload: taxpayerinfo };
  },


  // Get taxpayerinfo
  loadTaxpayerinfo: function(id) {
    return function(dispatch) {
      return TaxpayerinfoApi
        .getOneTaxpayerinfo(id)
        .then(taxpayerinfo => {
          dispatch(actionsFunction.loadTaxpayerinfoSuccess(taxpayerinfo));
        })
        .catch(error => {
          throw error;
        });
    };
  },

  loadTaxpayerinfoSuccess: function(taxpayerinfo) {
    return { type: types.GET_TAXPAYERINFO_SUCCESS, payload: taxpayerinfo };
  },

  // Load  list
  loadTaxpayerinfoList: function() {
    return function(dispatch) {
      return TaxpayerinfoApi
        .getTaxpayerinfoList()
        .then(list => {
          dispatch(actionsFunction.loadTaxpayerinfoListSuccess(list));
        })
        .catch(error => {
          throw error;
        });
    };
  },

  loadTaxpayerinfoListSuccess: function(list) {
    return { type: types.LIST_TAXPAYERINFO_SUCCESS, payload: list };
  },

	
  // Save taxpayerinfo
  saveTaxpayerinfo: function(taxpayerinfo) {
    return function(dispatch) {
      return TaxpayerinfoApi
        .saveTaxpayerinfo(taxpayerinfo)
        .then(taxpayerinfo => {
          dispatch(actionsFunction.saveTaxpayerinfoSuccess(taxpayerinfo));
        })
        .catch(error => {
          throw error;
        });
    };
  },

  saveTaxpayerinfoSuccess: function(taxpayerinfo) {
    return { type: types.UPDATE_TAXPAYERINFO_SUCCESS, payload: taxpayerinfo };
  },


};

export default actionsFunction;
